import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const HeaderContainer = styled.div`
  background: #1e3a8a;
  color: white;
  padding: 40px 30px 30px;
  position: relative;
`;

const NihcmLogo = styled.div`
  font-size: 1.5rem;
  font-weight: 700;
  margin-bottom: 5px;
  letter-spacing: 2px;
`;

const NewsletterTitle = styled.h1`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  font-weight: 400;
  line-height: 1.3;
  margin: 20px 0 10px;
`;

const IssueInfo = styled.div`
  font-size: 0.9rem;
  opacity: 0.9;
  font-weight: 300;
`;

const Header = () => {
  return (
    <HeaderContainer>
      <motion.div
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.2 }}
      >
        <NihcmLogo>NIHCM FOUNDATION</NihcmLogo>
        <NewsletterTitle>
          Primary Care Clinicians' Medicaid Participation: A Longitudinal Analysis
        </NewsletterTitle>
        <IssueInfo>Research Brief • September 2025 • Healthcare Workforce Analysis</IssueInfo>
      </motion.div>
    </HeaderContainer>
  );
};

export default Header;
